var getTallies=function(){$.ajax({url:"/api/user/tallies",type:"GET",dataType:"json",success:function(a){$(".tallies ul").html("");for(var b=0;k=a.length,b<k;b++)$(".tallies ul").append('<li><span class="user-mark" style="background-color: '+a[b].color+'"></span>'+a[b].name+": "+a[b].tally+"</li>")},error:function(){console.log("error getting tallies")}})};$("form").formjax({success:function(){getTallies()}}),$("form input").on("change",function(){parentCatId="#"+$(this).data("category"),$(parentCatId).submit(),$(parentCatId).find(".nominee--info").addClass("loser"),$(this).parents(".nominee--info").removeClass("loser").addClass("winner")}),getTallies();